function loadContent(n){$.get("/Main/LoadContent",{name:n},function(n){$("#main").html(n)},"html")}function setupBtnsSensorSelect(){$("#sidebar button.sensorNavBtn").click(function(){var n=$(this);n.hasClass("current")||(loadContent(n.attr("data-graph-sensor")),$("#sidebar button.current").removeClass("current"),n.addClass("current"))})}function changeChartData(n,t){var i=$("#chartData");i.attr(n)!==t&&(i.attr(n,t),getGraphPoints())}function setupBtnsSensorData(){$("#sensorDataBtns button").click(function(){changeChartData("data-graph-data",$(this).attr("data-graph-data"))})}function getGraphPoints(){var n=$("#chartData");$.getJSON("/Graph/GetGraphPoints",{start:n.attr("data-graph-start"),end:n.attr("data-graph-end"),sensor:n.attr("data-graph-sensor"),dataType:n.attr("data-graph-data"),scale:n.attr("data-graph-scale")},function(n){chartProperties.xAxis=n.xAxis;chartProperties.yAxis=n.yAxis;drawGraphForCanvas()})}function drawGraphForCanvas(){chartProperties.globalChart=new Chart($("#sensorChartHere"),{type:"line",data:{labels:chartProperties.xAxis,datasets:[{label:chartProperties.datasetLable,data:chartProperties.yAxis,lineTension:0,backgroundColor:chartProperties.backgroundColor,borderColor:chartProperties.borderColor}]},options:{scales:{yAxes:[{scaleLabel:{display:!0,labelString:chartProperties.labelString}}],xAxes:[{ticks:{maxTicksLimit:10,callback:function(n){return new Date(n).toLocaleDateString("de-DE",{month:"short",year:"numeric"})}}}]}}})}$("document").ready(function(){$("#main").text()===""&&loadContent("Home");setupBtnsSensorSelect()});var chartProperties={datasetLable:"Electrical Usage",backgroundColor:"rgba(255,255,0,.5)",borderColor:"rgba(255,255,0,1)",labelString:"kiloWatt Hours",xAxis:[],yAxis:[],globalChart:null};